import classes from "./profilePicture.module.css";
import { Cloudinary } from "@cloudinary/url-gen";

function ProfilePicture(props) {
    const request = props.requestData;

    const cld = new Cloudinary({cloud: {cloudName: 'pear-programming'}}); 
    const postImage = cld.image(props.profilePicture);

  return (
    <div className={classes.PFP}>
        <p className={classes.profileChar}>{props.firstName.charAt(0).toUpperCase()}</p>
        { props.profilePicture !== null ? <img src={postImage.toURL()}/> : null }
    </div>
  );
}

export default ProfilePicture;
